  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mackay
  Island NWR outlines activities and accomplishments during the 2001 calendar year.
  The report begins with an introduction to the Refuge. Highlights and weather conditions
  are summarized for the year. Information about monitoring and studies- including
  surveys and censuses and studies and investigations- is provided next. Habitat restoration
  and management projects are also covered; activities include moist soil management,
  fire management, and vegetation control. Fish and wildlife management are discussed
  next with emphasis on nest structures. The resource protection section provides
  an update on law enforcement. Information about public education and recreation
  is given including visitor services and outreach.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
